export class About extends React.Component {
    render() {
        return(
           <div className="card rounded body-color">
               <div className="card-header header-color">
                   about me
               </div>
               <div className="card-body">
                   Technical, entrepreneurial, and people-oriented individual located in Austin, Texas.
                   With my education, internships, and professional work, I have amassed a vast understanding of the
                   key principles of lifecycle management in SaaS solutions. I intend for these and future experiences
